        alt="cartoon sydney"> 
        </img>
      </div>
      <div className="landingWords">
        <h1>
          Sydney Meza
        </h1>
        <p>Hi! I'm Sydney an aspiring UIUX designer! <br/> I'm interested in human centered design along with</p>
      </div>

    </div>
  );
}

